// }
  

const fonts = {
  Roboto: {
    normal: 'assets/fonts/Roboto-Regular.ttf',
    bold: 'assets/fonts/Roboto-Medium.ttf',
    italics: 'assets/fonts/Roboto-Italic.ttf',
    bolditalics: 'assets/fonts/Roboto-MediumItalic.ttf',
  },
};

async function demoPDF({ recipientPhone, recipientName, eventArray}) {
    let allEvents = null;
    allEvents = eventArray.length;
  const docDefinition = {
    pageMargins: [0, 0, 0, 0], // Set page margins to zero
	content: [
		{
            stack: [
                {
                    image: 'data:image/jpeg;base64,',
                    alignment: 'center',
                    height: 200,
                    margin: [0, 0, 0, 10], // Add some margin between the image and text
                },
                {
                    text: 'Dental Patient Record',
                    fontSize: 24,
                    bold: true,
                    margin: [10, -50, 0, 20], // Set margin to zero for the text element
                    color: '#ffffff'
                }
            ]
        },
        {
			columns: [
                {
                    stack: [
                        {
                            image: 'data:image/jpeg;base64,',
                            fit: [200, 200],
                            alignment: 'center',
                            margin: [0, 10, 0, 30]
                        },
                        {
                            canvas: [
                                {
                                    type: 'rect',
                                    x: -20,
                                    y: 0,
                                    w: 290,
                                    h: 30,
                                    color: '#f5f7fa'
                                }
                            ]
                        },
                        {
                            text: 'PERSONAL INFORMATION',
                            margin: [40, -22, 0, 20], // Set margin to zero for the text element
                            color: '#515bf1',
                            bold: true,
                            fontSize: 12,
                        },
                        {
                            text: recipientName,
                            margin: [40, 10, 0, 0],
                            bold: false,
                            fontSize: 12,
                        },
                        {
                            text: recipientPhone,
                            margin: [40, 10, 0, 0],
                            bold: false,
                            fontSize: 12,
                        }
                    ],
                    margin: [0, 10, 0, 20],
                },
                {
                    stack: [
                        {
                            canvas: [
                                {
                                    type: 'rect',
                                    x: 20,
                                    y: 10,
                                    w: 290,
                                    h: 30,
                                    color: '#f5f7fa'
                                }
                            ]
                        },
                        {
                            text: 'PATIENT MEDICAL & DENTAL HISTORY',
                            margin: [40, -22, 0, 20], // Set margin to zero for the text element
                            color: '#515bf1',
                            bold: true,
                            fontSize: 12,
                        },
                        {
                            text: 'Total Appointments',
                            margin: [40, 0, 0, 0],
                            bold: false,
                            fontSize: 12,
                            color: 'gray'
                        },
                        {
                            text: allEvents,
                            margin: [40, 5, 0, 0],
                            bold: false,
                            fontSize: 12,
                        },
                        {
                            text: 'Appointments List',
                            margin: [40, 10, 0, 0],
                            bold: false,
                            fontSize: 12,
                            color: 'gray'
                        },
                        {
                            text: eventArray,
                            margin: [40, 5, 0, 0],
                            bold: false,
                            fontSize: 12,
                        },
                    ],
                    margin: [-20, 10, 0, 20],
                }
            ]
		},
        
	],
	defaultStyle: {
		columnGap: 20
	}
  };

  // Create a new instance of PdfPrinter
  const printer = new PdfPrinter(fonts);

  // Generate a PDF document using the document definition
  const pdfDoc = printer.createPdfKitDocument(docDefinition);

  const filePath = 'pdf-folder/test.pdf';

  // Pipe the PDF document to a file stream
  const fileStream = fs.createWriteStream(filePath);
  pdfDoc.pipe(fileStream);
  pdfDoc.end();

  // Create a promise to track when the file stream finishes writing
  const fileWritePromise = new Promise((resolve, reject) => {
    fileStream.on('finish', () => {
      resolve(); // Resolve the promise when writing finishes
    });

    fileStream.on('error', (err) => {
      reject(err); // Reject the promise if an error occurs
    });
  });

  // Wait for the file write promise to resolve before sending the HTTP request
  await fileWritePromise;

  // Send the PDF invoice as a document
  const response = await unirest
    .post('https://https://whatsapp-leko-tech.herokuapp.com//meta_wa_callbackurl')
    .headers({
      'Content-Length': fs.statSync(filePath).size.toString(),
      'Content-Type': 'application/pdf',
      'Content-Disposition': `attachment; filename="${filePath}"`,
    })
    .attach('file', filePath)
    .send();

  console.log('Response:', response.body);
}


module.exports = {
  demoPDF,
};
